import React from 'react';
import '../style/SkillsSection.css'; // Make sure to create this CSS file for your styles
import Bootstrap from './/../img/icons8-bootstrap-logo-48.png';
import JavaScript from './/../img/icons8-javascript-48.png';
import HTML from './/../img/icons8-html-logo-48.png';
import CSS from './/../img/icons8-css-logo-48.png';
import REACT from './/../img/icons8-react-native-48.png';

const skills = [
  { id: 1, title: 'HTML', description: 'Proficient in HTML5, building responsive layouts.', icon: 'fab fa-html5' },
  { id: 2, title: 'CSS', description: 'Expert in CSS3, focusing on modern design techniques.', icon: 'fab fa-css3-alt' },
  { id: 3, title: 'JavaScript', description: 'Skilled in JavaScript, building dynamic web applications.', icon: 'fab fa-js' },
  // Add more skills as needed
];

 <img src={Bootstrap} alt="icon" className="img-fluid rounded-custom mb-3"
 width="200"/>

const SkillsSection = () => {
  return (
    <section className="skills-section">
      <div className="container">
        <h2 id='skills'>Skills</h2>
        <div className="row">
          {skills.map(skill => (
            <div className="col-md-4" key={skill.id}>
              <div className="skill-card">
                <div className="skill-icon">
                  <i className={skill.icon}></i> {/* FontAwesome icon */}
                </div>
                <div className="skill-title">{skill.title}</div>
                <div className="skill-description">{skill.description}</div>
              </div>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default SkillsSection;
